<div class="entities" style="line-height: 2.5; direction: ltr">Modeling of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q14654
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and inhibition mechanism of the natural ligand , ellagic acid , using molecular docking . Diabetes mellitus is a disorder in which blood sugar ( glucose ) levels are abnormally high because the body does not produce enough insulin to meet its needs . Post-prandial hyperglycemia ( PPHG ) is an independent risk factor for the development of macro vascular complications . It is now recognized that normalizing post-prandial blood glucose is more difficult than normalizing fasting glucose . DB01345 channels are the most widely distributed type of ion channel and are found in virtually all living organisms . The function of KATP channels is best understood in pancreatic beta cells , the membrane potential of which is responsive to external glucose concentration . Beta cells show a remarkably complex electrical bursting behavior in response to an increase in glucose level . DB00731 and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 are a class of insulin secretagog agents that lowers blood glucose levels by stimulating insulin secretion from the pancreas . These compounds interact with the DB00171 - sensitive potassium ( K + DB00171 ) channel in pancreatic beta cells . However , the side effects of these drugs overpass their uses , and the need to identify compounds with less adverse effects is exigent . In our research study , we used the natural compound ellagic acid , which is an already proven anti-carcinogen , anti-mutagen , and anticancer initiator , for its anti-diabetic activity in comparison to the two commercial drugs ( DB00731 and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) . The drugs and the compounds were docked to the DB00171 - dependent potassium channel and their energy value showed that the compound had higher binding value than the commercial drugs . Then an ADME / Tox analysis for the compound was carried out which showed that ellagic can be a possible lead molecule .</div>

 selective endothelin antagonist . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06268
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( 3 , TBC 11251 ) ( Wu et al . J . Med . Chem . 1997 , 40 , 1690 ) is an orally active ET ( A ) selective endothelin antagonist that attenuates pulmonary vascular hypertension and cardiac hypertrophy in rats ( Tilton et al . Pulm . Pharmacol . Ther . 2000 , 13 , 87 ) . It has demonstrated efficacy in a phase II clinical trial for congestive heart failure ( Givertz et al . Circulation 2000 , 101 , 2922 ) . During the discovery of 3 , we observed several structure-oral bioavailability relationships . To investigate whether there is any generality in these trends , we synthesized some similar pairs of compounds in the latest series ( Wu et al . J . Med . Chem . 1999 , 42 , 4485 ) and evaluated their oral properties . In both series , an acyl group at the 2 - position of the anilide of these thiophene sulfonamides improved oral bioavailability . As a result of this exercise , TBC 3214 ( 17 ) was identified as a sitaxsentan follow-on candidate . It is very potent ( IC ( 50 ) for ET ( A ) = 40 pM ) and highly selective for ET ( A ) vs ET ( B ) receptors ( 400 000 - fold ) , with a half-life of &gt; 4 h and oral bioavailability of 25 % in rats , 42 % in cats , and 70 % in dogs .</div>

 receptors and alpha 2C adrenoceptor . In this study , the effects of lurasidone on the rat passive-avoidance response and its impairment by the N-methyl-D-aspartate ( DB01221 ) receptor antagonist MK - 801 ( dizocilpine ) were evaluated and compared with those of other antipsychotics . The passive-avoidance response was examined by measuring the step-through latency , 1 day after the animals received foot-shock training . When given before the training session , lurasidone did not affect the passive-avoidance response at any dose tested ( 1-30 mg / kg , p . o . ) . All the other atypical antipsychotics examined ( i . e . , risperidone , olanzapine , quetiapine , clozapine and aripiprazole ) , however , significantly reduced the step-through latency at relatively high doses . A pre-training administration of lurasidone significantly and dose-dependently reversed the MK - 801 - induced impairment of the passive-avoidance response . At doses lower than those that affected the passive-avoidance response , risperidone , quetiapine , and clozapine partially reduced the MK - 801 - induced impairment , whereas haloperidol , olanzapine , and aripiprazole were inactive . In addition , the post-training administration of lurasidone was as effective in countering the MK - 801 effect as the pre-training administration , suggesting that lurasidone worked , at least in part , by restoring the memory consolidation process disrupted by MK - 801 . These results suggest that lurasidone is superior to other antipsychotics in improving the MK - 801 - induced memory impairment and may be clinically useful for treating cognitive impairments in schizophrenia .</div>
